import React from 'react';
import ListGroup from 'react-bootstrap/ListGroup';

export default class Categories extends React.Component {
  render() {
    return (
      <div style={{borderRadius: '10px'}}>
        <ListGroup.Item className='text-center sidebar-item life' style={{border: 'none'}}><h4>Life</h4></ListGroup.Item>
        <ListGroup.Item className='text-center sidebar-item work' style={{border: 'none'}}><h4>Work</h4></ListGroup.Item>
        <ListGroup.Item className='text-center sidebar-item senior-design' style={{border: 'none'}}><h4>Senior Design</h4></ListGroup.Item>
        <ListGroup.Item className='text-center sidebar-item intro-to-computer-architecture' style={{border: 'none'}}><h4>Intro to Computer Architecture</h4></ListGroup.Item>
        <ListGroup.Item className='text-center sidebar-item innovation-and-design' style={{border: 'none'}}><h4>Innovation and Design</h4></ListGroup.Item>
        <ListGroup.Item className='text-center sidebar-item intro-to-cybersecurity' style={{border: 'none'}}><h4>Intro to Cybersecurity</h4></ListGroup.Item>
      </div>
    )
  }
}
